import React from 'react'
import "./Note.css"

function Note(props) {

    function handleClick() {
        props.onDelete(props.id);
    }

    return (
        <div>
        <div className="note">
            <div className="detail">
                <h1 className="text-dark">{props.title}</h1>
                <p className="text-secondary">{props.start} - {props.end}</p>
            </div>

            <div className="actions">
                <span className="edit text-primary" onClick={handleClick}><i class="fas fa-pencil-alt"></i></span>
                <span className="text-primary" onClick={handleClick}><i class="fas fa-trash-alt"></i></span>
            </div>
        
        </div>
        <hr ckassName="hr" />
        </div>
    )
}

export default Note
